import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { NgForm } from '@angular/forms';

@Injectable({
  providedIn: 'root'
})
export class DataService {

  private url = 'https://api.sheety.co/45604bc63728735dab6c1b62ccf11028/filterkriterienAnbotsabgabe/orgEhImScope%20%28infoOnly%29';

  constructor(private http: HttpClient) { }

  getData(): Observable<any> {
    return this.http.get(this.url);
  }

  
  //--------------------------------------------MINDESTPREIS------------------------------------------------------------------------------
  
  data: any[] = [];
  editedItem: any;


  getMinPrice(): Observable<any> {
    const url = 'https://api.sheety.co/45604bc63728735dab6c1b62ccf11028/filterkriterienAnbotsabgabe/mindestpreis';
    return this.http.get(url);
  }

  
  editItem(item: any) {
    this.editedItem = Object.assign({}, item);
  }

  
  onSubmit(form: NgForm, id: number, data: any): Observable<any> {
    const url = `https://api.sheety.co/45604bc63728735dab6c1b62ccf11028/filterkriterienAnbotsabgabe/mindestpreis/${id}`;
    const body = {
      //ACHTUNG DER TYPO IST BEACHBSICHTIGT!! SHEETY ERWARTET "mindestprei" OHNE "s"
      mindestprei: data
    };
    return this.http.put(url, body);
  }

  


}
